  render() {
    return (
      <div className = "App">
        <Navbar dark color = "dark">
          <div className = "container">
            <NavbarBrand href = "/">Amliya da dhaba </NavbarBrand>
          </div>
        </Navbar>
        <Menu dishes={this.state.dishes} />
      </div>
    );
  }
}

export default App;
